import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useParams } from "react-router";
import axios from "axios";

export default function UpdateWorkout() {
  const [type, setType] = useState("");
  const [date, setDate] = useState("");
  const [location, setLocation] = useState("");
  const [workoutLength, setWorkoutLength] = useState("");
  const [completed, setCompleted] = useState("");
  const [errorsObj, setErrorsObj] = useState({});

  const navigate = useNavigate();
  const { id } = useParams();

  const loadWorkouts = async () => {
    const { data } = await axios.get(`http://127.0.0.1:8000/api/${id}`);
    console.log("Data: ", data);
    console.log("ðŸš€ ~ Update Workout Data:", data);

    // Allows us to access all of our saved form data
    setType(data.type);
    setDate(data.date);
    setLocation(data.location);
    setWorkoutLength(data.setWorkoutLength);
    setCompleted(data.completed);
  };

  useEffect(() => {
    loadWorkouts();
  }, []);

  return (
    <>
      <h1>Update Page</h1>
    </>
  );
}
